import React from "react";

function Index() {
  return (
    <div className="block lg:flex w-full px-4 lg:px-56 xl:px-64 py-4 bg-smokegrey text-sm lg:text-base xl:text-lg justify-center ">
      <p className="flex  ">
        By accessing using this website, you acknoledge that you have read and
        understand our{" "}
        <a href="" className="text-blue">
          Cookie Police
        </a>
        , <a></a> Privacy Police, and our Terms of service
      </p>
      <button className="w-24 lg:w-32 h-10 lg:h-12 mt-4 lg:mt-0 text-white rounded bg-blue">
        Got it
      </button>
    </div>
  );
}

export default Index;
